import React from 'react';

export default class List extends React.Component {
  render() {
    return (
      <div className='h6'>
        <h6>
          <b>{this.props.name}</b>
          <div className='btn'>
            <span></span>
            <span></span>
          </div>
        </h6>
      </div>
    );
  }
}
